import React, { Component } from "react";
import Card from "../Component/Card/card";

export default class Home extends Component {
  render() {
    return (
      <div class="container mt-5">
        <div class="row">
          <div class="col">
            <Card 
            title={"Bench Grinding Machine"}
            text={" A grinding machine, often shortened to grinder, is one of power tools or machine tools used for grinding, it is a type of machining using an abrasive wheel as the cutting tool."}
            />
          </div>

          <div class="col">
            <Card 
              title={"Lathe Machine"}
              text={" Lathes are one of the most versatile machine tools in the industry, used to perform a variety of machining operations( Ex Facing, Tapering& Boring etc)."}
            />
          </div>
          <div class="col">
            <Card 
              title={"Radical Drill Machine"}
              text={"A radial drilling machine or radial arm press is a geared drill head that is mounted on an arm assembly that can be moved around to the extent of its arm reach."}
            />
          </div>
          <div class="col">
            <Card 
              title={"Gauge Feeler"}
              text={" A feeler gauge or a gap gauge is a tool - or, more commonly, a set of tools - used to check the width of small gaps between objects placed very close together. "}
            />
          </div>
        </div>

        <div class="row mt-5 mb-5">
          <div class="col">
            <Card 
             title={"Bench Grinding Machine"}
             text={" A grinding machine, often shortened to grinder, is one of power tools or machine tools used for grinding, it is a type of machining using an abrasive wheel as the cutting tool."}
            />
          </div>

          <div class="col">
            <Card 
             title={"Bench Grinding Machine"}
             text={" A grinding machine, often shortened to grinder, is one of power tools or machine tools used for grinding, it is a type of machining using an abrasive wheel as the cutting tool."}
            />
          </div>
          <div class="col">
            <Card 
              title={"5/2 Way Valve"}
              text={" 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."}
            />
          </div>
          <div class="col">
            
          </div>
        </div>
      </div>
    );
  }
}
